import React from "react";

const Career = () => {
  return (
    <div className="career">
      <h1>Career</h1>
      <p>
        Mario’s football journey began in Belgium, where his raw talent and dedication quickly set him apart. 
        Through youth academies and professional development, he earned his place among Europe’s emerging stars.
        Known for his creative midfield play, vision, and technical skill, Mario continues to rise and make an impact on the pitch.
      </p>
    </div>
  );
};

export default Career;
